class Cl  extends Component
{
    constructor(props){
    super(props);
    this.props=props;
    this.state= {
        name: "sachin",
        age: 34,
    };
    }
    harri=()=>{
        this.setState({name:"data",
            age:66
        })
    }
    render(){
        return(
        <> 
         <h1>
             <i>{this.state.name} sachin mahajan{this.state.age}</i>
             
        </h1>
            <button type="button" onClick={this.harri()}>Click</button>
         </>

        )
    }
}      
export default Cl
